import React,{ Component } from "react";
import Book from "./bookItem";

class Books extends Component {
state = {
    book: {
        id: "",
        name: "Name",
        details: "qqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqq",
        info: "wwwwwwwwwwwwwwwwwwwwwwwwwwww",
    }
 }

 hello() {
     console.log("Hello");
 }
    render() {
        return (
            <>
            <div>Books List</div>
            <div>
            {Object.entries(this.state.book).map(
                  ([bookdName, bookState]) => {
                    return (
                      <>
                      <div onClick="hello">
                        <Book
                           name={this.state.book.name}
                           id={this.state.book.id}
                           detail={this.state.book.details}
                           info={this.state.book.info}
                           onClick={this.hello}
                        ></Book>
                        </div>
                      </>
                    );
                  }
                )}
            </div>
            </>
        )
    }
}

export default Books;
